import { StyleSheet, Text, View } from 'react-native'
import data from '../../Constantes/Produits.json'
const Poissons = () => {
    return (
        <View>
            <Text> Poisson ici</Text>
            <View> {data[0].name}</View>
        </View>
    )
}

export default Poissons

const styles = StyleSheet.create({})
